import React from "react";
import "./App.css";
import LandingPage from "./components/LandingPage/LandingPage";
import NewUser from "./components/LandingPage/NewUser";

import Board from "./components/Board/Board"
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>

          <Route path="/board">
            <Board />
          </Route>
          <Route path="/">
            <LandingPage />
          </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
